            <div>
            <div className = "handOne" style={{top:'20%', left:'12%'}}/>
            <div className = "handTwo" style={{top:'40%', left:'12%'}}/>
            <div className = "handThree" style={{top:'40%', left:'2%'}}/>
            <div className = "handFour" />
            <div className = "handFive" />
            <div className = "handSix" />
            <div className = "handSeven" />
            </div>
        );
    }
}

export default PlayerHand;
